    s = [0] * (N + 20)
    for (B, U) in ladders:
        s[B] = U
    a[1] = 0
    if s[1] != 0:
        z = s[1]
        while z != 0:
            a[z] = 0
            z = s[z]
    for i in range(1, N):
        if s[i] == 0 and a[i] != 100000:
            for j in range(2, 13):
                if i + j <= N and a[i + j] > a[i] + 1:
                    a[i + j] = a[i] + 1
                    z = s[i + j]
                    while z != 0 and i + j <= N:
                        a[z] = a[i + j]
                        z = s[z]
    return a[N]

